def aes_decrypt(
        data: str | bytes,
        key: bytes | None = None,
        iv: bytes | None = None,
) -> str:
    """Decrypt AES."""
    if len(data) == 0:
        return ""
    if key is not None:
        aes_key = key
        aes_iv = iv
    if aes_key is None:
        raise ValueError("Encrypt need a key")
    if isinstance(data, str):
        data = bytes.fromhex(data)
    if aes_iv is None or aes_iv == b"0":  # ECB
        return unpad(
            AES.new(aes_key, AES.MODE_ECB).decrypt(data),
            len(aes_key),
        ).decode()
    return unpad(
        AES.new(aes_key, AES.MODE_CBC, iv=aes_iv).decrypt(data),
        len(aes_key),
    ).decode()

